import React from 'react';
import './MainMenu.css';
import Menu01 from './menu-01/Menu01'

function MenuOne({setIndex, menu01, menu02, menu03, menu04}){

    return(
            <div>
                {menu01 && <div>Menu01</div>}
                {menu02 && <div>2</div>}
                {menu03 && <div>3</div>}
                {menu04 && <div>4</div>}
            </div>
    )
}

export default MenuOne;
